    e.preventDefault();
    nextStep();
  };

  return (
    <div className=" ">
      <div>
        <h1>Hello</h1>
        <p>Welcome to the progi test</p>
        <p>
          Please note that this will be the absolute best software youve ever
          touched
        </p>
        <Button onClick={handleClick} variant="primary" type="submit">
          Continue
        </Button>
      </div>
    </div>
  );
};

